import Cd2 from "./cd2";
import { Route, Router, Routes } from "react-router-dom";

function Ravi(){
    return(
        <div>
           <Router>
               <Routes>
                   <Route path="/"element={<Cd2/>}></Route>
               </Routes>
           </Router>
        </div>
    )
}
export default Ravi;
